import React from "react";
import { Container, Row, Col, Form, Button } from "react-bootstrap";
import { EnvelopeAt } from "react-bootstrap-icons";
import { useState } from "react";
import axios from "axios";

const Contact = () => {
  const [full_name, setFullName] = useState("");
  const [email, setEmail] = useState("");
  const [type_of_inquiry, setSelectInquiry] = useState("");
  const [inquiry_description, setInquiryDescription] = useState("");
  const [result, setResult] = useState("")

  const handleChange = (event) => {
    setFullName(event.target.value);
    setEmail(event.target.value);
    setSelectInquiry(event.target.value);
    setInquiryDescription(event.target.value);
  }

  const submitHandle = () => {
    const url = "http://localhost/contact.php";
    let formData = new FormData();
    formData.append("full-name", full_name);
    formData.append("email", email);
    formData.append("inquirySelect", type_of_inquiry);
    formData.append("inquiryDescription", inquiry_description);

    axios.post(url, formData)
    .then(response => alert(response.data))
    .catch(error => alert(error));
  }

  return (
    <section id="contact-and-support">
      <Container
        fluid
        style={{
          paddingTop: "5rem",
          height: 1400,
          fontFamily: "primary-font",
        }}
      >
        <Row>
          <Col xs={4} lg={8}>
            <div
              style={{
                backgroundColor: "#F9E95D",
                width: 900,
                height: 1505,
                position: "absolute",
                top: 4500,
                left: 0,
                zIndex: -1,
              }}
            ></div>
            <h1
              style={{
                fontSize: 55,
                marginLeft: "8rem",
                position: "relative",
              }}
            >
              Would you like to get in touch with us? Or you need assistance?
            </h1>
            <p
              className="w-75"
              style={{
                fontSize: 25,
                marginTop: "2rem",
                marginLeft: "8rem",
                fontFamily: "secondary-font",
                position: "relative",
              }}
            >
              You can actually do both, feel free to contact us, regardless of
              needing assistance or just a small talk with us.
            </p>
            <Form
              onSubmit={submitHandle}
              style={{
                width: "45%",
                padding: "0 3rem",
                marginTop: "3rem",
                marginLeft: "5rem",
                fontSize: 25,
              }}
            >
              <Form.Group
                controlId="fullName"
                style={{
                  marginBottom: "2rem",
                }}
              >
                <Form.Label>Your full name</Form.Label>
                <Form.Control
                  onChange={(event) => setFullName(event.target.value)}
                  type="text"
                  name="full-name"
                  value={full_name}
                  style={{
                    borderBottom: "3px solid black",
                    height: "3rem",
                  }}
                ></Form.Control>
              </Form.Group>
              <Form.Group
                controlId="emailAddress"
                style={{
                  marginBottom: "2rem",
                }}
              >
                <Form.Label>Your email address</Form.Label>
                <Form.Control
                  onChange={(event) => setSelectInquiry(event.target.value)}
                  type="email"
                  name="email"
                  
                  style={{
                    borderBottom: "3px solid black",
                    height: "3rem",
                  }}
                ></Form.Control>
              </Form.Group>
              <Form.Group
                controlId="selectInquiry"
                style={{
                  marginBottom: "2rem",
                }}
              >
                <Form.Label>Select the type of inquiry</Form.Label>
                <Form.Select
                  onChange={(event) => setInquiryDescription(event.target.value)}
                  name="inquirySelect"
                  value={type_of_inquiry}
                  style={{
                    borderBottom: "3px solid black",
                    height: "3rem",
                    fontSize: 20,
                  }}
                >
                  <option>Appointment</option>
                  <option>Addressing a question</option>
                  <option>Support/Assistance</option>
                </Form.Select>
              </Form.Group>
              <Form.Group
                controlId="describeInquiry"
                style={{
                  marginBottom: "2rem",
                }}
              >
                <Form.Label>Describe your inquiry</Form.Label>
                <Form.Control
                  onChange={(event) => setEmail(event.target.value)}
                  type="text"
                  name="inquiryDescription"
                  style={{
                    borderBottom: "3px solid black",
                    height: "10rem",
                  }}
                ></Form.Control>
              </Form.Group>
              <Button
                type="submit"
                value="submit"
                style={{
                  fontSize: 30,
                  fontWeight: "bold",
                  backgroundColor: "#7F7EC7",
                  color: "whitesmoke",
                  borderBottom: "4px solid black",
                  marginTop: "1rem",
                }}
              >
                Submit
              </Button>{" "}
            </Form>
          </Col>

          <Col xs={4} lg={8}>
            <EnvelopeAt
              size={500}
              style={{
                position: "absolute",
                left: 800,
                top: 5280,
              }}
            ></EnvelopeAt>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Contact;
